import { useState } from "react";
import { FaRegCalendarAlt, FaRegHeart, FaBell, FaSignOutAlt } from "react-icons/fa";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import "./Dashboard.css"; // Import the CSS file

export default function Dashboard() {
  const [activeTab, setActiveTab] = useState("tracker");

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <aside className="sidebar">
        <h2 className="sidebar-title">CycleCare Dashboard</h2>
        <nav>
          <ul className="sidebar-menu">
            <li className={activeTab === "tracker" ? "active-tab" : ""} onClick={() => setActiveTab("tracker")}>Tracker</li>
            <li>Mood Tracker</li>
            <li>Health Tips</li>
            <li>Reminders</li>
          </ul>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <header className="header">
          <h1 className="header-title">Welcome to Your Menstrual Tracker</h1>
          <Button className="logout-button"><FaSignOutAlt className="icon" /> Logout</Button>
        </header>

        <div className="grid-container">
          <Card>
            <CardContent>
              <h3 className="card-title">Next Predicted Period</h3>
              <p className="card-text">March 15, 2025</p>
            </CardContent>
          </Card>
          <Card>
            <CardContent>
              <h3 className="card-title">Current Phase</h3>
              <p className="card-text">Follicular</p>
            </CardContent>
          </Card>
        </div>

        {/* Tabs */}
        <div className="tabs">
          <span className={activeTab === "tracker" ? "active-tab" : ""} onClick={() => setActiveTab("tracker")}>Tracker</span>
          <span>Mood Tracker</span>
          <span>Health Tips</span>
          <span>Reminders</span>
        </div>

        {/* Content Cards */}
        <div className="grid-container">
          <Card>
            <CardContent>
              <h3 className="card-title">Track Your Cycle</h3>
              <p>Monitor your cycle length, predict your next period, and get insights.</p>
              <Button className="primary-button">Learn More</Button>
            </CardContent>
          </Card>
          <Card>
            <CardContent>
              <h3 className="card-title">Track Your Mood</h3>
              <p>Log your mood daily to identify patterns and improve mental health.</p>
              <Button className="primary-button">Log Mood</Button>
            </CardContent>
          </Card>
        </div>
      </main>
    </div>
  );
}




